        public void  Add(List<string> tone)
        {
            int i = 219;
            while (i++ < 315 && ToneNames[i][0] != "") ;
            if (i < 315)
            {
                for (int j = 0; j < tone.Count; j++)
                {
                    ToneNames[i][j] = tone[j];
                }
            }
        }

        public void ClearAt(int index)
        {
            for (int i = 0; i < 88; i++)
            {
                ToneNames[index][i] = "";
            }
        }

        public Int32 Drumset(String Group, String DrumSetName)
        {
            Boolean found = false;
            Int32 index = 0;
            while (!found && index < ToneNames.Length)
            {
                if (ToneNames[index][0] == Group && ToneNames[index][1] == DrumSetName)
                {
                    return index;
                }
                index++;
            }
            return -1;
        }

