        public List<String> KeyboardNameList(String Group, String ToneName)
        {
            Int32 col = 1;
            Boolean found = false;
            List<String> names = null;
            try
            {
                if (Group == "SRX-01: Dynamic Drum Kits" && !ToneName.EndsWith(" Menu"))
                {
                    // Special case. Each set represents multiple voices. Match last word of tone name with specific set name.
                    while (!found && col < ToneNames[0].Length)
                    {
                        while (!found && ToneNames[col][0] == Group)
                        {
                            //if (ToneName.ToLower().EndsWith(ToneNames[1][col].ToLower().Remove(0, ToneName.LastIndexOf(' ') + 1)))
                            if ((ToneName.ToLower().EndsWith("kit") && ToneNames[col][1].EndsWith("Drum Kit"))
