                            {
                                names = new List<String>();
                                for (Int32 i = 2; i < 88; i++)
                                {
                                    if (!String.IsNullOrEmpty(ToneNames[col][i]))
                                    {
                                        names.Add(ToneNames[col][i]);
                                    }
                                    else
                                    {
                                        names.Add("");
                                    }
                                }
                                found = true;
                            }
                            col++;
                        }
                        col++;
                    }
                }
                else
                {
                    while (!found && col < ToneNames.Length)
                    {
                        if (ToneNames[col][0] == Group && ToneNames[col][1] == ToneName)
                        {
                            names = new List<String>();
                            for (Int32 i = 2; i < ToneNames[0].Length; i++)
                            {
                                if (!String.IsNullOrEmpty(ToneNames[col][i]))
                                {
                                    names.Add(ToneNames[col][i]);
                                }
